import styled from '@emotion/styled';

const MessagesContainer = styled.div`
padding: 2% 5% 0% 5%;
display: flex;
flex-direction: column-reverse;
align-items: center;

   @media (min-width: 800px) {
      margin-top: -30px; 
`;

export default MessagesContainer
